Agência de empregos e seleção de talentos!
Serviços de recrutamento e seleção de candidatos;
Mão de obra temporário e contrato por tempo determinado;
Divulgação de vagas;

A RH Center é uma parceira estratégica de serviços de RH que atende empresas de diversos segmentos desde 1997. 

A experiência nessa área e a evolução que o atendimento a centenas de clientes nos proporcionou, nos permitiu aprimorar a nossa atuação e, por conta disso, oferecemos soluções que estimulam tanto o crescimento quanto melhores resultados dos nossos clientes. 

Ao longo dos anos, investimos em tecnologias e ferramentas que facilitam o oferta de nossos serviços, que incluem:

➡ Processamento e folha de pagamento;
➡ Terceirização de mão de obra;
➡ Captação de talentos (recrutamento e seleção); 
➡ Avaliação comportamental.
